import React from "react";
import "./Button.css";
import styled from 'styled-components';

const Button = (props) => {styled.button`
  background: purple;
  color: white;
  font-size: 1em;
  margin: 1em;
  padding: 0.25em 1em;
  border: 2px solid palevioletred;
  border-radius: 3px;
`
  return (
    <div>
      <Button className={"button-style"}>
        {props.children}
      </Button>
    </div>
  );
}

export default Button;
